import "bulma/css/bulma.min.css"
import { useAuth0 } from "@auth0/auth0-react"
import Cookies from "universal-cookie"
import "./style.css"
import { useEffect, useState } from "react"
import Modal from "@mui/material/Modal"
import Box from "@mui/material/Box"
import Typography from "@mui/material/Typography"
import Request from "../Request/index.jsx"

const NavTray = () => {
	useEffect(() => {
		// Check to see if this is a redirect back from Checkout
		const query = new URLSearchParams(window.location.search)

		if (query.get("success")) {
			alert(`Order processed! You will receive an email confirmation.`)
		}

		if (query.get("cancelled")) {
			alert(
				`Order canceled -- continue to shop around and checkout when you're ready.`
			)
		}
	}, [])

	const { logout } = useAuth0()
	const cookies = new Cookies()

	// create variables for a settings modal to be used later
	const [settingsModal, setSettingsModal] = useState(false)
	const handleOpen = () => setSettingsModal(true)
	const handleClose = () => setSettingsModal(false)

	// create a variable for the dark mode toggle
	const [darkMode, setDarkMode] = useState(false)

	// make an async function that clears the cookies, which can be chained with a .then to call logout later
	const clearCookies = async () => {
		await cookies.remove("token")
	}

	const style = {
		position: "absolute",
		top: "50%",
		left: "50%",
		transform: "translate(-50%, -50%)",
		width: 400,
		bgcolor: "background.paper",
		boxShadow: 24,
		p: 4,
	}

	const handleCheckout = (e) => {
		const commandsRequest = new Request(
			"api/stripe/create-checkout-session/",
			{
				method: "POST",
			}
		)

		commandsRequest
			.then((response) => {
				console.log(response)
			})
			.catch((err) => {
				console.log(err)
			})
	}

	return (
		<div className="navbtn-tray">
			<div className="purple-line-break"></div>
			<div className="nav-button">
				<i className="fa-solid fa-up-right-from-square"></i>
				<span>&nbsp;</span>
				Guides and FAQ
			</div>
			<div className="nav-button" onClick={handleCheckout}>
				<i className="fa-solid fa-credit-card"></i>
				<span>&nbsp;</span>
				Upgrade
			</div>
			<div className="nav-button" onClick={handleOpen}>
				<i className="fa-solid fa-cog"></i>
				<span>&nbsp;</span>
				Settings
			</div>

			<Modal
				open={settingsModal}
				onClose={handleClose}
				aria-labelledby="settings-modal-title"
				aria-describedby="settings-modal-description"
			>
				<Box sx={style}>
					<div className="settings-modal-header">
						<Typography
							id="settings-modal-title"
							variant="h6"
							component="h2"
						>
							Settings
						</Typography>

						<div
							className="nav-button"
							onClick={handleClose}
							style={{ float: "right" }}
						>
							<i className="fa-solid fa-times"></i>
							<span>&nbsp;</span>
							Close
						</div>
					</div>

					<Typography id="settings-modal-description" sx={{ mt: 2 }}>
						<div className="settings-modal-body">
							<div className="settings-modal-item">
								<div className="settings-modal-item-left">
									<i className="fa-solid fa-moon"></i>
									<span>&nbsp;</span>
									Dark Mode
								</div>
								<div className="settings-modal-item-right">
									<input
										type="checkbox"
										checked={darkMode}
										onChange={() => {
											setDarkMode(!darkMode)
											if (darkMode) {
												document.body.classList.remove(
													"dark"
												)
											} else {
												document.body.classList.add(
													"dark"
												)
											}
										}}
									/>
								</div>
							</div>
							<div className="settings-modal-item">
								<div className="settings-modal-item-left">
									<i className="fa-solid fa-bell"></i>
									<span>&nbsp;</span>
									Notifications
								</div>
								<div className="settings-modal-item-right">
									<input type="checkbox" />
								</div>
							</div>
						</div>
					</Typography>
				</Box>
			</Modal>

			<div
				className="nav-button"
				onClick={() => {
					clearCookies().then(() =>
						logout({ returnTo: window.location.origin })
					)
				}}
			>
				<i className="fa-solid fa-sign-out"></i>
				<span>&nbsp;</span>
				Log Out
			</div>
		</div>
	)
}

export default NavTray
